import React, { Component } from 'react'
import AlumnoService from '../services/AlumnoService';

class AlumnosComponent extends Component {
    constructor(props) {
        super(props)

        this.state = {
            alumnos: []
        }
    }

    componentDidMount() {
        AlumnoService.getAlumnos().then((res) => {
            this.setState({ alumnos: res.data });
        });
    }

    render() {
        return (
            <div class="container">
    <div class="card-dark mb-4 ">
        <div class="card-body">
            <h2 class="text-center mb-4">Alumnos</h2>
            <div class="table-responsive">
                <table class="table table-dark table-striped table-bordered table-rounded">
                    <thead>
                        <tr>
                            <th>Rut</th>
                            <th>Apellidos</th>
                            <th>Nombres</th>
                            <th>Fecha de nacimiento</th>
                            <th>Tipo de colegio</th>
                            <th>Nombre del colegio</th>
                            <th>AÃ±o de egreso</th>
                            <th>Arancel</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.alumnos.map(alumno => (
                            <tr key={alumno.rut}>
                                <td>{alumno.rut}</td>
                                <td>{alumno.apellidos}</td>
                                <td>{alumno.nombres}</td>
                                <td>{alumno.fecha_nacimiento}</td>
                                <td>{alumno.tipo_colegio}</td>
                                <td>{alumno.nombre_colegio}</td>
                                <td>{alumno.ano_egreso}</td>
                                <td>{alumno.arancel}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    </div>
</div>


        )
    }
}

export default AlumnosComponent
